Actionscript.script:
轻按屏幕唤起按键._visible = 1;
平板UI中间动画._visible = 1;
基建按钮._visible = 0;
联络按钮._visible = 0;
图鉴按钮._visible = 0;
支线查询按钮._visible = 0;
材料大全按钮._visible = 0;
角色信息按钮._visible = 0;
文本收集按钮._visible = 0;
单位说明按钮._visible = 0;
阵营信息按钮._visible = 0;
无人机._visible = 0;
基建悬停说明._visible = 0;
联络悬停说明._visible = 0;
图鉴悬停说明._visible = 0;
材料内容整体._visible = 0;
var 进入基建界面:Boolean = false;
var 进入联络界面:Boolean = false;
var 进入图鉴界面:Boolean = false;
var 按钮占用:Boolean = false;
var 已关闭空闲动画:Boolean = false;

gotoAndStop("初始界面");

按钮占用 = true;
this.基建悬停说明._visible = 0;
this.基建悬停说明.gotoAndPlay(1);

按钮占用 = false;
进入基建界面 = false;
gotoAndStop("初始界面");

按钮占用 = true;
无人机._visible = 1;
this.联络悬停说明._visible = 0;
this.联络悬停说明.gotoAndPlay(1);

无人机._visible = 0;
按钮占用 = false;
进入联络界面 = false;
gotoAndStop("初始界面");

按钮占用 = true;
this.图鉴悬停说明._visible = 0;
this.图鉴悬停说明.gotoAndPlay(1);
this.支线查询按钮._visible = 1;
this.支线查询按钮.gotoAndPlay(2);
this.材料大全按钮._visible = 1;
this.材料大全按钮.gotoAndPlay(2);
this.角色信息按钮._visible = 1;
this.角色信息按钮.gotoAndPlay(2);
this.文本收集按钮._visible = 1;
this.文本收集按钮.gotoAndPlay(2);
this.单位说明按钮._visible = 1;
this.单位说明按钮.gotoAndPlay(2);
this.阵营信息按钮._visible = 1;
this.阵营信息按钮.gotoAndPlay(2);

this.支线查询按钮._visible = 0;
this.材料大全按钮._visible = 0;
this.角色信息按钮._visible = 0;
this.文本收集按钮._visible = 0;
this.单位说明按钮._visible = 0;
this.阵营信息按钮._visible = 0;
按钮占用 = false;
进入图鉴界面 = false;
gotoAndStop("初始界面");

if(this.轻按屏幕唤起按键._visible == 1 && this.平板UI中间动画._visible == 1)
   {
	   this.轻按屏幕唤起按键.play();
	   this.平板UI中间动画.play();
   }

this.图鉴按钮.gotoAndStop(20);
this.支线查询按钮.gotoAndStop(20);
this.材料大全按钮.gotoAndStop(20);
this.角色信息按钮.gotoAndStop(20);
this.文本收集按钮.gotoAndStop(20);
this.单位说明按钮.gotoAndStop(20);
this.阵营信息按钮.gotoAndStop(20);

on (press) {
	if (this.已关闭空闲动画 == true)
	{
		this.gotoAndPlay("基建界面进入");
	}
}
on (rollOver) {
	if (this.已关闭空闲动画 == true)
	{
		this.基建悬停说明._visible = 1;
		this.基建悬停说明.play();
	}
}
on (rollOut) {
	this.基建悬停说明._visible = 0;
	this.基建悬停说明.gotoAndStop(1);
}

on (press) {
	if (this.已关闭空闲动画 == true)
	{
		this.gotoAndPlay("联络界面进入");
	}
}
on (rollOver) {
	if (this.已关闭空闲动画 == true)
	{
		this.联络悬停说明._visible = 1;
		this.联络悬停说明.play();
	}
}
on (rollOut) {
	this.联络悬停说明._visible = 0;
	this.联络悬停说明.gotoAndStop(1);
}

on (press) {
	if (this.已关闭空闲动画 == true)
	{
		this.gotoAndPlay("图鉴界面进入");
	}
}
on (rollOver) {
	if (this.已关闭空闲动画 == true)
	{
		this.图鉴悬停说明._visible = 1;
		this.图鉴悬停说明.play();
	}
}
on (rollOut) {
	this.图鉴悬停说明._visible = 0;
	this.图鉴悬停说明.gotoAndStop(1);
}

on (press) {
	this.gotoAndPlay("基建界面返回");
}

on (press) {
	this.gotoAndPlay("联络界面返回");
}

on (press) {
	this.gotoAndPlay("图鉴界面返回");
}

on (press) {
	this.gotoAndPlay("材料大全界面进入");
}

on (press) {
	this.gotoAndPlay("材料大全界面返回");
}

on (press) {
	this.gotoAndPlay("图鉴界面返回");
}

on (press) {
	this.gotoAndPlay("材料大全界面进入");
}

on(release){
   if(_parent.轻按屏幕唤起按键._visible == 1 && _parent.平板UI中间动画._visible == 1)
   {
	   _parent.轻按屏幕唤起按键.play();
	   _parent.平板UI中间动画.play();
	   _parent.基建按钮._visible = 1;
	   _parent.基建按钮.play();
	   _parent.联络按钮._visible = 1;
	   _parent.联络按钮.play();
	   _parent.图鉴按钮._visible = 1;
	   _parent.图鉴按钮.play();
   }
   //_parent._parent.stopDrag();
}

